rge_tables(fruit, fungus, fish)\n    elseif currentPet == \"Crab\" then \n        edible = merge_tables(fruit, fungus, bread, fish)\n    elseif currentPet == \"Boar\" or currentPet == \"Bear\" then\n        edible = merge_tables(cheese, fruit, fungus, bread, fish, meat)\n    end\n    \n    for i=1, #edible do\n        if GetItemCount(edible[i]) > 0 then \n            food = edible[i]\n            if food ~= 0 then break end\n        end\n    end\n    \n    if food == 0 then \n        return \"Out of Vendor Food\"\n    else \n        return \"Feed Pet!\"\n    end\nend\n\n\n",
