cheese, fruit, fungus, bread, fish, meat)\nend\n\nfor i=1, #edible do\n    if GetItemCount(edible[i]) > 0 then \n        food = edible[i]\n        if food ~= 0 then break end\n    end\nend\n\nlocal r = WeakAuras.regions[\"Rubot's PetFeeder Classic\"].region\nlocal b = CreateFrame(\"Button\", \"FeedButton\", r, \"SecureActionButtonTemplate\")\n\nb:SetAllPoints()\n\nb:SetAttribute(\"type\", \"spell\");\nb:SetAttribute(\"spell\", \"Feed Pet\");\nb:SetAttribute(\"target-item\", food);",
