				["actions"] = {
					["start"] = {
					},
					["init"] = {
						["custom"] = "aura_env.tracked = {}\naura_env.checker = function()\n    if IsSpellKnown(2383) then\n        aura_env.tracked[133939] = \"herbs\"\n    end\n    if IsSpellKnown(2580) then\n        aura_env.tracked[136025] = \"minerals\"\n    end\n    if IsSpellKnown(43308) then\n        aura_env.tracked[133888] = \"fish\"\n    end \n    if IsSpellKnown(2481) then\n        aura_env.tracked[135725] = \"treasure\"\n    end \nend\naura_env.checker()\n\n\n",
