							["custom_type"] = "stateupdate",
							["subeventSuffix"] = "_CAST_START",
							["subeventPrefix"] = "SPELL",
							["duration"] = "1",
							["event"] = "Chat Message",
							["names"] = {
							},
							["unevent"] = "timed",
							["custom"] = "function(states, event, ...)\n    if event == \"LEARNED_SPELL_IN_TAB\" then\n        aura_env.checker()\n    end\n    \n    if not next(aura_env.tracked) or not MiniMapTrackingFrame then return end\n    \n    if event == \"MINIMAP_UPDATE_TRACKING\" then\n        --IsShown() delayed\n        C_Timer.After(0.5, function() WeakAuras.ScanEvents(\"PLAYER_STARTED_MOVING\") end)\n    end\n    \n    if event == \"PLAYER_STARTED_MOVING\" or event == \"OPTIONS\" then\n        local shown = MiniMapTrackingFrame:IsShown()\n        if not shown then\n            states[\"\"] = {\n                name = \"NOT TRACKING\",\n                icon = 134440,\n                tracking = false,\n                autoHide = false,\n                changed = true,\n                show = true,   \n            }\n        else\n            if aura_env.config.hide then\n                if states[\"\"] then\n                    states[\"\"].show = false\n                    states[\"\"].changed = true\n                end\n                return true\n            end\n            local icon = MiniMapTrackingIcon:GetTexture()\n            if icon then\n                local name = aura_env.tracked[icon]\n                if name then \n                    states[\"\"] = {\n                        name = name,\n                        icon = icon,\n                        tracking = true,\n                        autoHide = false,\n                        changed = true,\n                        show = true,   \n                    }\n                elseif aura_env.config.showOthers then\n                    states[\"\"] = {\n                        name = \"other\",\n                        icon = icon,\n                        tracking = true,\n                        autoHide = false,\n                        changed = true,\n                        show = true,   \n                    }\n                end\n            end\n        end\n    end\n    return true\nend",
